import React from 'react';
function Tabs()
{
    return(
        <div className="tab-main">
            <div className="container">
            <div className="delivery">
               <section>
                <img className="icons" src="https://b.zmtcdn.com/data/o2_assets/c0bb85d3a6347b2ec070a8db694588261616149578.png" alt="delivery"></img>
                <a href="delivery">Delivery</a>
                </section>
                <img className="icons" src="https://b.zmtcdn.com/data/o2_assets/78d25215ff4c1299578ed36eefd5f39d1616149985.png" alt="Dining out"></img>
                <a href="delivery">Delivery</a>

                <img className="icons"  src=" https://b.zmtcdn.com/data/o2_assets/01040767e4943c398e38e3592bb1ba8a1616150142.png" alt="Night life"></img>
                <a href="delivery">Delivery</a>

                <img className="icons" src="https://b.zmtcdn.com/data/o2_assets/54cad8274d3c3ec7129e0808a13b27c31616582882.png" alt="abcde"></img>
                <a href="delivery">Delivery</a>
            </div>
            
            </div>
        </div>
    )
}
export default Tabs;
